import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses=[
    {id:'e1',Title:"food",date:new Date(2023,10,16),cost:10},
    {id:'e2',Title:"toilet paper",date:new Date(2023,10,15),cost:80},
    {id:'e3',Title:"car",date:new Date(2023,10,14),cost:100000},
    {id:'e4',Title:"camera",date:new Date(2023,10,13),cost:5000}
  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem Title={expenses[0].Title} cost={expenses[0].cost} date={expenses[0].date}></ExpenseItem>
      <ExpenseItem ></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
